function addToCart(elements) {
	const cart = document.getElementById('cart');
	
	// If msg is set
	if( document.getElementById('empty_cart_msg')) {
		cart.removeChild(document.getElementById('empty_cart_msg'));
	}
	// Add new product
	const new_product = document.createElement('div');
	new_product.classList.add("cart_product");

	for(var key in elements) {
		if(key !== 'id') {
			var value = elements[key];
			var elt;
			// If qtty > create a select (to edit qtty)
			if(key === 'quantity') {
				elt = document.createElement('select');
				const options_array = [1, 2, 3, 4, 5];
				for (var i = 0; i < options_array.length; i++) {
				    var option = document.createElement("option");
				    option.value = options_array[i];
				    option.text = options_array[i];
				    elt.appendChild(option);
				}
				elt.selectedIndex = value - 1;
			} else {
				elt = document.createElement('p').appendChild(document.createTextNode(value));
			}
			new_product.appendChild(elt);
			}
	}
    document.getElementById("menu_cart").classList.add('swing');
	elt = document.createElement('i');
	elt.classList.add('fas', 'fa-trash-alt');
	new_product.appendChild(elt);
	cart.appendChild(new_product);
}

