function alreadyInCart(current_product_id, current_product_quantity, current_product_color) {
	if(items.length >= 1) {
		for(var i = 0; i <= items.length; i++) {
			if(items[i] && items[i].id === current_product_id && items[i].color === current_product_color) {

				// Already in cart
				const qtty = items[i].quantity;
				// Update qtty
				items[i].quantity = parseInt(qtty) + parseInt(current_product_quantity);
				// Update localstorage
                localStorage.setItem("products", JSON.stringify(items));
				return true;
			}
		}
	}
	return false;
}

